import React from 'react';
import { Grid,Typography,Button, AppBar, Toolbar, IconButton } from '@mui/material';
import { styled } from '@mui/material/styles';
import {useNavigate} from 'react-router-dom';
import Charity from '../../images/charityHelp.jfif';
import '../../css/Home.css';
import Kids from '../../images/hunger.jfif';


const HelpUsButton = styled(Button)(({ theme }) => ({
  color: 'theme.pallette.text',
  backgroundColor: 'theme.pallete.main',
  '&:hover': {
    backgroundColor: '#000000',
  },
  marginLeft:'35%',
  marginTop:'15%'
}));

const LoginButton = styled(Button)(({ theme }) => ({
  color: 'theme.pallette.text',
  backgroundColor: 'theme.pallete.main',
  '&:hover': {
    backgroundColor: '#000000',
  },
  marginLeft:'35%',
  marginTop:'15%'
}));

const StyledButton = styled(Button)(({ theme }) => ({
  color: 'theme.pallette.text',
  backgroundColor: 'theme.pallete.main',
  '&:hover': {
    backgroundColor: '#000000',
  },
}));

const Styledappbar = styled(AppBar)(({theme}) =>({
  backgroundColor:'#000000',
  display:'flex',
  height:'10vh',
  width:'100%'
}));


export default function Home() {
  let navigate = useNavigate();

  let startButtonClick = ()=>{
    navigate('/login');
  }



  return (
    <div>
      <Styledappbar position='sticky' elevation={4}>
        <Toolbar>
          <Typography variant='h4' sx={{flex:1}}>
            Eden's Garden
          </Typography>
          <LoginButton onClick={startButtonClick}>
            Login
          </LoginButton>
        </Toolbar>
      </Styledappbar>
      <div className='container'>
        <div className='item'>
          <div className='item-1a'>
          <Typography variant='subtitle1' sx={{ color:'#FFFFFF'}}>
              Every year, the US wastes about 40% of the food it produces.
            </Typography>
            <Typography variant='subtitle1' sx={{ color:'#FFFFFF'}}>
              Meanwhile, over 41 million people in the US face hunger.
            </Typography>
            <Typography variant='subtitle1' sx={{ color:'#FFFFFF'}}>
              At Eden's Garden, We make sure this doesn't happen.
            </Typography>
            <HlButton onClick={startButtonClick} variant='contained'>Help Us</HlButton>
          </div>
        </div>
        <div className='item'>
          Hello World
        </div>
